import React from 'react'
import {Card, CardBody } from "reactstrap";
import {Link} from 'react-router-dom';

const TourCard = ({tour}) => {
    const {id, title, photo, featured, avgRating, reviews } = tour
  return (
    <div className='tour__card'>
    <Card>
        <div className='tour__card'>
            <img src={photo} alt="" />
        </div>
    </Card>
      TourCard
    </div>
  )
}

export default TourCard
